  "title": {
    "nb": "Ledige stillinger meldt til NAV - historikk"
  },
  "description": {
    "nb": "Ledige stilinger meldt til NAV inneholder strukturert informasjon om ledige stillinger meldt til NAV i løpet av året. Det publiseres også et eget datasett med utlysningstekster ledige stillinger. Disse to datasett kan kobles sammen via felles nøkkel stilling_id.Stillinger meldt til NAV har fem kilder: 1) stillinger meldt til NAV-kontorene som oppdrag, 2) stillinger registrert av arbeidsgiver på nav.no, 3) stillinger offentliggjort i media (stillingsportaler, websider, aviser, tidsskrifter, o.l.) og registrert av NAV, 4) stillinger meldt til NAV fra Eures nettverk for ledige stillinger i Europa og 5) stillinger hentet basert på avtaler mellom NAV og private stillingsdatabaser i Norge.Datasettet er basert på offisiell stilingsstatistikk med tillegg av stillinger fra Eures. Datasett inneholder detaljer om den enkelte stilling: stillingsnummer, registreringsdato, siste publiseringsdato for stilling, statistikkperiode (år og måned), arbeidssted fylke og kommune, yrkeskoder, virksomhet organisasjonsnummer og navn, antall stillinger i stillingsannonse og stillingstittel. Stillingsdata meldes og registreres i NAV basert på arbeidsmarkedsloven §7. Datasett inneholder organisasjonsnummer som kan kobles med andre datasett på data.norge.no som enhetsregister, sektorbeskrivelse, næringsgruppering for ytterligere opplysninger om virksomhet. NAV benytter den norske versjonen STYRK av den internasjonale standarden for yrkesklassifisering (ISCO) for stilingsregistrering. Fra 2001 til 2011 er stillinger klassifisert etter STYRK og fra 2012 etter STYRK-08. Se komplett kodekatalog hos SSB: STYRK-kode som også kan benyttes for kobling til flere statistikkgrupperinger. Antall stillinger i NAVs stilingsdatabase økte i 2017 pga samarbeid med andre aktører i stillingsmarkedet. Se mer informasjon i Om statistikken ledige stillinger finnes på nav.no.NAV publiserer også et grensesnitt for RSS og annen online tilgang til ledige stillinger på nav.no.Vasking av data: For stillingsutlysninger meldt til NAV-kontorene så er navn og organisasjonsnummer utelatt i datasett da noen av disse stillingene er meldt i kategorien \"Arbeidsgiver som ønsker å annonsere etter arbeidskraft uten å oppgi sitt navn\".Datasett publiseres årlig med en datafil per år. "
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003e\u003cstrong\u003eLedige stilinger meldt til NAV\u003c/strong\u003e inneholder strukturert informasjon om ledige stillinger meldt til NAV i løpet av året. Det publiseres også et eget datasett med \u003ca href\u003d\"http://data.norge.no/data/arbeids-og-velferdsetaten-nav/utlysningstekster-ledige-stillinger-historikk\" rel\u003d\"nofollow\"\u003eutlysningstekster ledige stillinger\u003c/a\u003e. Disse to datasett kan kobles sammen via felles nøkkel stilling_id.\u003c/p\u003e\u003cp\u003eStillinger meldt til NAV har fem kilder: 1) stillinger meldt til NAV-kontorene som oppdrag, 2) stillinger registrert av arbeidsgiver på nav.no, 3) stillinger offentliggjort i media (stillingsportaler, websider, aviser, tidsskrifter, o.l.) og registrert av NAV, 4) stillinger meldt til NAV fra Eures nettverk for ledige stillinger i Europa og 5) stillinger hentet basert på avtaler mellom NAV og private stillingsdatabaser i Norge.\u003c/p\u003e\u003cp\u003eDatasettet er basert på offisiell stilingsstatistikk med tillegg av stillinger fra Eures. Datasett inneholder detaljer om den enkelte stilling: stillingsnummer, registreringsdato, siste publiseringsdato for stilling, statistikkperiode (år og måned), arbeidssted fylke og kommune, yrkeskoder, virksomhet organisasjonsnummer og navn, antall stillinger i stillingsannonse og stillingstittel. Stillingsdata meldes og registreres i NAV basert på arbeidsmarkedsloven §7. Datasett inneholder organisasjonsnummer som kan kobles med andre datasett på data.norge.no som \u003ca href\u003d\"https://data.norge.no/data/registerenheten-i-br%C3%B8nn%C3%B8ysund/enhetsregisteret\" rel\u003d\"nofollow\"\u003eenhetsregister, \u003c/a\u003e\u003ca href\u003d\"https://data.norge.no/data/registerenheten-i-br%C3%B8nn%C3%B8ysund/sektorkoder-i-enhetsregisteret\" rel\u003d\"nofollow\"\u003esektorbeskrivelse\u003c/a\u003e, \u003ca href\u003d\"https://data.norge.no/data/registerenheten-i-br%C3%B8nn%C3%B8ysund/n%C3%A6ringskoder-i-enhetsregisteret\" rel\u003d\"nofollow\"\u003enæringsgruppering \u003c/a\u003efor ytterligere opplysninger om virksomhet. NAV benytter den norske versjonen STYRK av den internasjonale standarden for yrkesklassifisering (ISCO) for stilingsregistrering. Fra 2001 til 2011 er stillinger klassifisert etter STYRK og fra 2012 etter STYRK-08. Se komplett kodekatalog hos SSB: \u003ca href\u003d\"https://www.ssb.no/klass/klassifikasjoner/7/koder\" rel\u003d\"nofollow\"\u003eSTYRK-kode \u003c/a\u003esom også kan benyttes for kobling til flere statistikkgrupperinger. Antall stillinger i NAVs stilingsdatabase økte i 2017 pga samarbeid med andre aktører i stillingsmarkedet. Se mer informasjon i \u003ca href\u003d\"https://www.nav.no/1073745796/om-statistikken-ledige-stillinger?kap\u003d1\" rel\u003d\"nofollow\"\u003eOm statistikken ledige stillinger\u003c/a\u003e finnes på nav.no.\u003c/p\u003e\u003cp\u003eNAV publiserer også et grensesnitt for \u003ca href\u003d\"https://tjenester.nav.no/stillinger/\" rel\u003d\"nofollow\"\u003eRSS og annen online \u003c/a\u003etilgang til ledige stillinger på nav.no.\u003c/p\u003e\u003cp\u003eVasking av data: For stillingsutlysninger meldt til NAV-kontorene så er navn og organisasjonsnummer utelatt i datasett da noen av disse stillingene er meldt i kategorien \"Arbeidsgiver som ønsker å annonsere etter arbeidskraft uten å oppgi sitt navn\".\u003c/p\u003e\u003cp\u003eDatasett publiseres årlig med en datafil per år.\u003c/p\u003e\u003cp\u003e \u003c/p\u003e"
  },
