  "title": {
    "nb": "Statistikk - utbetalinger av ytelser kommune år"
  },
  "description": {
    "nb": "Data om de faktiske utbetalingene fra NAV fordelt på de ulike hovedytelsene, og deretter fordelt per fylke og kommune. Gjennom statistikken får man svar på hvor mye penger NAV utbetaler til personer på de ulike ytelsene i hver enkelt kommune. Statistikken omfatter hovedtyngden av stønader fra NAV til individer. Inkluderte stønader:tiltakspenger,kontantstøtte,barnetrygd,krigspensjon,supplerende stønad til personer over 67 år,foreldrepenger, - dagpenger (eksl. feriepenger),enslige forsørgere,sykepenger (ekskl tilretteleggingstilskudd),arbeidsavklaringspenger (eksl. legeerklæringer),uføre (uførepensjon, uføretrygd),grunn- og hjelpestønad,alderspensjon,ytelser til gjenlevende,tilleggstønader (felles for flere stønadsområder fra 2016).Se Om statistikken - Utbetalinger til personer per fylke og kommune for mer detaljer."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eData om de faktiske \u003cstrong\u003eutbetalingene fra NAV \u003c/strong\u003efordelt på de ulike hovedytelsene, og deretter fordelt per fylke og kommune. Gjennom statistikken får man svar på hvor mye penger NAV utbetaler til personer på de ulike ytelsene i hver enkelt kommune. Statistikken omfatter hovedtyngden av stønader fra NAV til individer. Inkluderte stønader:\u003c/p\u003e\u003cul\u003e\u003cli\u003etiltakspenger,\u003c/li\u003e\u003cli\u003ekontantstøtte,\u003c/li\u003e\u003cli\u003ebarnetrygd,\u003c/li\u003e\u003cli\u003ekrigspensjon,\u003c/li\u003e\u003cli\u003esupplerende stønad til personer over 67 år,\u003c/li\u003e\u003cli\u003eforeldrepenger, - dagpenger (eksl. feriepenger),\u003c/li\u003e\u003cli\u003eenslige forsørgere,\u003c/li\u003e\u003cli\u003esykepenger (ekskl tilretteleggingstilskudd),\u003c/li\u003e\u003cli\u003earbeidsavklaringspenger (eksl. legeerklæringer),\u003c/li\u003e\u003cli\u003euføre (uførepensjon, uføretrygd),\u003c/li\u003e\u003cli\u003egrunn- og hjelpestønad,\u003c/li\u003e\u003cli\u003ealderspensjon,\u003c/li\u003e\u003cli\u003eytelser til gjenlevende,\u003c/li\u003e\u003cli\u003etilleggstønader (felles for flere stønadsområder fra 2016).\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eSe \u003ca href\u003d\"https://www.nav.no/no/NAV+og+samfunn/Statistikk/Flere+statistikkomrader/Relatert+informasjon/om-statistikken-utbetalinger-til-personer-per-fylke-og-kommune\" rel\u003d\"nofollow\"\u003eOm statistikken - Utbetalinger til personer per fylke og kommune\u003c/a\u003e for mer detaljer.\u003c/p\u003e"
  },
