  "title": {
    "nb": "Sjøkart - raster Svalbardkart"
  },
  "description": {
    "nb": "Hovedkartserien Svalbard, Jan Mayen og Bouvetøya består av 21 sjøkart i målestokk: 1:15 000 til 1:100 000. Den dekker kystnære polare strøk. Store deler av Svalbard gjenstår før området er dekket av kart i målestokk 1:100 000, selv om det er den mest vanlige målestokken. Oppdateringer legges inn ca. hver 14. dag i takt med Efs utgivelse."
