  "title": {
    "nb": "Digital 3D-bymodell Trondheim"
  },
  "description": {
    "nb": "Trondheim kommune etablerte i 2014 en digital 3D-bymodell for et område på ca 36 km2 i og rundt sentrum av byen. Trondheim 3D Bymodell er en digital gjengivelse av Trondheim kommune i form av en større 3D-modell basert på informasjon fra kartdata (FKB-A/B), laserdata og ortofoto fra 2014 samt skråbilder fra 2013 og gatebilder fra 2014 (noen utvalgte områder). Modellen er basert på følgende programvareversjoner: 3ds Max Design 2014, Forest Pro 4.3.6 og Unity 4. Koordinatsystem er EUREF89 UTM Sone32 og høydesystem er NN2000."
