  "title": {
    "nb": "Matrikkelen - Adresse Leilighetsnivå"
  },
  "description": {
    "nb": "Fysiske adresser registrert i Matrikkelen. En offisiell adresse er den fullstendige adressen for en bygning, bygningsdel, bruksenhet, eiendom eller et annet objekt. En adresse er enten Vegadresse (Storgata 10) eller Matrikkeladresse (33/2-2). Her leveres adressen på leilighetsnivå, -det vil si med bruksenhetsnummer (H0102). En bygning med f.eks ti leiligheter er representert med ti adresseobjekter. \n\nAdressen er merket med tilhørighet til postkrets, grunnkrets, valgkrets, tettsted og sokn og i tillegg er adressens (her bruksenhetens) knytning til matrikkelnummer (eiendom) med. Adresserte bygningsendringer er ikke med i dette produktet. Lokal-Id (fra matrikkelsystemet) er hentet fra bruksenheter i matrikkelen, - ikke adressen. Adresser som ikke gjelder byginger eller som mangler knytning mot bruksenhet i matrikkelen har ingen Lokal-Id.\n\nDistribusjoner er satt opp mot en løsning som gir noe forsinkelse fra det offisielle Matrikkelsystemet (fra ca. 10 minutters forsinkelse på WFS og for nedlasting av fritt valgt område fra kart, en dags forsinkelse for kommunevise filer og WMS og ukentlig for fylkes-/landsfiler). Ved større endringer/lastinger kan forsinkelse bli lenger. \n\nKjent feil: Oppdateringsdato på et adresseobjekt endres ikke ved endret adressenavn fordi i veg er eget objekt. Endringer i kretstilhørighet kan også ha en forsinket oppdatering i distribusjonsdatabasen."
  },
