  "title": {
    "nb": "Reindrift - Flyttlei"
  },
  "description": {
    "nb": "Datasettet beskriver lengre leier eller traséer i terrenget der reinen enten drives eller trekker selv mellom årstidsbeitene. Hovedsakelig symboliserer flyttlei en aktiv flytting / driving av rein, og ifølge reindriftslovens § 22 må ikke reindriftens flyttleier stenges. Bredden vil variere, blant annet etter terrenget og snøforholdene samt størrelsen og samlingen på flokken. Beitelommer / overnattingsbeite er markert som utvidelser. Høstflyttingen foregår som oftest mer spredt og over adskillig lenger tid enn vår-flyttingen. Derfor er ofte høstleia bredere. Kartene er å regne som illustrasjon på hvordan reindriftsnæringen i hovedsak og normalt bruker områdene. Lov om reindrift (reindriftsloven) regulerer hvilke rettigheter og plikter reindrifts-utøvere har i forhold til arealbruk."
  },
