  "description": {
    "nb": "Mange typer skred gjentar seg på samme plass. Det gjelder både for de nesten årvisse skredene, som er et kjent problem i mange deler av landet, og for de langt mer sjeldne skredene. Kunnskap om skred som har gått gjennom historien bidrar til en bedre forståelse av skredfaren i et område. Opplysninger om tidligere skred er derfor viktig ved kartlegging av skredutsatte områder. Skredhendelser er:\nSkredhendelser - omkomne, Skredhendelser - skredtype, Skredhendelser - konsekvens og Skredhendelser - snøskred."
