  "title": {
    "nb": "Arealressurskart - AR250"
  },
  "description": {
    "nb": "AR250 er et heldekkende datasett som viser landets arealressurser i lys av deres egnethet for jord- og skogbruk. Datasettet er tilpasset visualisering i målestokker fra 1:100 000 til 1:300 000 (fylkes- og regionnivå). \n\nDatasettet er fremstilt ved en generalisering av arealressurskartet AR5 under tregrensa, og tolking av satellittbilder over tregrensa. I tillegg er N250 brukt der det verken fantes AR5 eller egnede satellittbilder. Figurer som er mindre enn 100 dekar vises ikke på kartet, men blir slått sammen med tilgrensende områder. AR250 er dermed ikke egnet til romlige analyser eller produksjon av arealstatistikk. Datasettet oppdateres en gang hvert tredje år med siste års versjon av FKB-AR5 (Arealressurskart i målestokk 1:5000 i databasen pr. 31.12). Siste oppdatering har data fra 31.12.2016."
  },
