  "title": {
    "nb": "Videregående skoler"
  },
  "description": {
    "nb": "Datasettet inneholder offentlige og private videregående skoler i Norge med tilhørende kontaktinformasjon og opplysninger. For enkelte skoler kan posisjonsnøyaktigheten avvike. Dataene hentes fra en Nasjonalt skoleregister API som drives av Utdanningsdirektoratet (https://data-nsr.udir.no/swagger/). Dataene i Nasjonalt Skoleregister oppdateres basert på informasjon fra Virksomhets- og foretaksregisteret (VoF)/Brønnøysundregisteret, Grunnskolens Informasjonssystem (GSI) og andre kilder. I GSI registreres situasjonen pr. 1. oktober hvert år. Data blir offentlig tilgjengelige i GSI i slutten av desember som gjør at informasjon i NSR kan ha endret seg siden forrige oppdatering. Se GSIs webside for siste oppdateringsdato (www.gsi.udir.no)."
  },
  "descriptionFormatted": {
    "nb": "Datasettet inneholder offentlige og private videregående skoler i Norge med tilhørende kontaktinformasjon og opplysninger. For enkelte skoler kan posisjonsnøyaktigheten avvike. Dataene hentes fra en Nasjonalt skoleregister API som drives av Utdanningsdirektoratet (https://data-nsr.udir.no/swagger/). Dataene i Nasjonalt Skoleregister oppdateres basert på informasjon fra Virksomhets- og foretaksregisteret (VoF)/Brønnøysundregisteret, Grunnskolens Informasjonssystem (GSI) og andre kilder. I GSI registreres situasjonen pr. 1. oktober hvert år. Data blir offentlig tilgjengelige i GSI i slutten av desember som gjør at informasjon i NSR kan ha endret seg siden forrige oppdatering. Se GSIs webside for siste oppdateringsdato (www.gsi.udir.no)."
  },
