  "title": {
    "nb": "Fastmerker - Landsnett og stamnett"
  },
  "description": {
    "nb": "Datasettet Fastmerker deles inn i tre grupper:\nStam- og landsnettpunkter er bestemt med GNSS og er de mest nøyaktige fastmerkene. Ligger som oftest i rimelig avstand fra vei.\nTrekantpunkter er bestemt ved eldre vinkel- og avstandsmålinger og er derfor mindre nøyaktige. De anbefales ikke der det er høye krav til nøyaktighet. Trekantpunkter finnes også i områder langt fra vei. Mange av trekantpunktene i lavlandet er uegnet for GNSS-måling. \nHøydefastmerkene er meget godt bestemt i høyde ved presisjonsnivellement, men grunnrisskoordinatene er i mange tilfeller svært upresise. Mange høydefastmerker nær vei er dessverre gått tapt."
  },
