  "title": {
    "nb": "Steinsprang - aktsomhetsområder"
  },
  "description": {
    "nb": "Aktsomhetsområder for steinsprang er en nasjonal kartserie som viser potensielt steinsprangutsatte områder på oversiktsnivå. Kartene viser potensielle løsneområder og utløpsområder for steinsprang.\nDet gjøres oppmerksom på at arealene som dekkes av utløsningsområder i praksis også er utløpsområder, ettersom skred som løsner helt øverst i et utløsningsområde beveger seg gjennom nedenforliggende utløsningsområder før det når utløpsområdene nedenfor. Ved bruk av datasettet til analyseformål bør derfor som en hovedregel både utløsningsområder og utløpsområder benyttes sammen.\nAktsomhetsområdene er identifisert ved bruk av en datamodell som gjenkjenner mulige løsneområder for steinsprang ut fra helning på terreng og geologisk informasjon. Fra hvert kildeområde er utløpsområdet for steinsprang beregnet automatisk. Det er ikke gjort feltarbeid ved identifisering eller avgrensning av områdene."
  },
