  "title": {
    "nb": "Reindrift - Reinbeiteområde"
  },
  "description": {
    "nb": "Datasettet avgrenser de seks reinbeiteområdene som tilsammen utgjør det samiske reinbeiteområdet. Retten til å utøve reindrift innenfor disse områdene er eksklusiv for den samiske befolkning. Denne samiske særretten gjelder ikke utenfor disse områdene, hvor det kreves særskilt tillatelse for å utøve reindrift på egne og leide arealer. Et reinbeiteområde utgjør en administrativ enhet for flere reinbeitedistrikt. Fylkesmannen er forvaltningsmyndighet i reinbeiteområdene."
