  "title": {
    "nb": "Snøskred - aktsomhetsområder"
  },
  "description": {
    "nb": "Aktsomhetsområder for snøskred er en nasjonal kartserie som viser potensielt snøskredutsatte områder (aktsomhetsområder) på oversiktsnivå. Kartene viser potensielle utløsningsområder og utløpsområder for snøskred. \nDet gjøres oppmerksom på at arealene som dekkes av utløsningsområder i praksis også er utløpsområder, ettersom skred som løsner helt øverst i et utløsningsområde beveger seg gjennom nedenforliggende utløsningsområder før det når utløpsområdene nedenfor. Ved bruk av datasettet til analyseformål bør derfor som en hovedregel både utløsningsområder og utløpsområder benyttes sammen.\nAktsomhetsområdene er identifisert ved bruk av en datamodell som ut fra helning på terrenget gjenkjenner terreng der utløsning av snøskred er mulig. Fra hvert utløsningsområde er utløpsområdet automatisk beregnet. Det er ikke gjort feltarbeid ved avgrensning av områdene, og effekten av lokale faktorer (f. eks. skog, terrengdetaljer, utførte sikringstiltak o.l.) er derfor ikke vurdert. \n\nAktsomhetsområdene gjelder ikke skredfare knyttet til sørpeskred."
  },
