    "nb": "Datasettet trekklei viser viktige naturlige trekk mellom beiteområder og forbi passasjer, der reinen trekker av seg selv, enten enkeltvis eller i flokk. Kartene er å regne som illustrasjon på hvordan reindriftsnæringen i hovedsak og normalt bruker områdene. Lov om reindrift (reindriftsloven) regulerer hvilke rettigheter og plikter reindrifts-utøvere har i forhold til arealbruk."
  },
