  "title": {
    "nb": "DTM 10 Terrengmodell (UTM32)"
  },
  "description": {
    "nb": "Digital terrengmodell over fastlands-Norge med høyder i et rutenett på 10 x 10 meter. Terrengmodellen er en rutenettsmodell med oppløsning (rutenettstørrelse) på 10 x 10 meter. \n\n Nøyaktighet:\n± 2 til 3 meter standardavvik i høyde avhengig av terreng og kartdataenes alder i FKB A – C-området.\n± 4 til 6 meter standardavvik i høyde avhengig av terreng og kartdataenes alder utenfor FKB A – C-området.\n\nArbeidet med ajourhold av dette datasettet blir ikke prioritert. De siste filene som ble oppdatert er fra 2013. Kartverket prioriterer isteden etablering av Nasjonal detaljert høydemodell (hoydedata.no), der nye høydemodeller tilgjengeliggjøres etter hvert som de blir produsert.\nPå hoydedata.no finnes også ferdigproduserte eksporterer av landsdekkende terrengmodeller med 10 meters oppløsning. Disse er generert ut fra detaljerte laserdata der slike finnes. Dette suppleres med høydedata fra 2013-utgaven av DTM10 dersom det er nødvendig for å få full dekning."
  },
  "descriptionFormatted": {
    "nb": "Digital terrengmodell over fastlands-Norge med høyder i et rutenett på 10 x 10 meter. Terrengmodellen er en rutenettsmodell med oppløsning (rutenettstørrelse) på 10 x 10 meter. \n\n Nøyaktighet:\n± 2 til 3 meter standardavvik i høyde avhengig av terreng og kartdataenes alder i FKB A – C-området.\n± 4 til 6 meter standardavvik i høyde avhengig av terreng og kartdataenes alder utenfor FKB A – C-området.\n\nArbeidet med ajourhold av dette datasettet blir ikke prioritert. De siste filene som ble oppdatert er fra 2013. Kartverket prioriterer isteden etablering av Nasjonal detaljert høydemodell (hoydedata.no), der nye høydemodeller tilgjengeliggjøres etter hvert som de blir produsert.\nPå hoydedata.no finnes også ferdigproduserte eksporterer av landsdekkende terrengmodeller med 10 meters oppløsning. Disse er generert ut fra detaljerte laserdata der slike finnes. Dette suppleres med høydedata fra 2013-utgaven av DTM10 dersom det er nødvendig for å få full dekning."
