  "title": {
    "nb": "Jordsmonn - Jordressurs"
  },
  "description": {
    "nb": "Jordressurs er et kartlag i datasettet Jordsmonn som viser dyrka mark inndelt i fire klasser hvor inndelingen er basert på enkelte jordsmonnegenskapers begrensende innvirkning på bruken av jorda. Egenskap som skal brukes til å fremstille kartlaget heter JR_KLASSE. Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. Geografisk objekt er jordtype."
  },
