  "title": {
    "nb": "Webkamera",
    "en": "CCTV"
  },
  "description": {
    "nb": "Statens vegvesen har satt opp flere webkamera langs veinettet. Dette er oftest i tilknytning til værutsatte steder, på fergeleier, ved fjelloverganger og i tettsteder med mye trafikk. Kameraene oppdateres med varierende frekvens. Dette har sammenheng med typen kamera og hvordan kommunikasjonen med kameraet er satt opp.\r\n\r\nMan må bestille tilgang til statens vegvesen sin DATEX node før man kan kople seg på publikasjonen.\r\n",
    "en": "CCTV is deployed in specific points or road sections with challenging weather conditions, like mountain passes or with heavy traffic, in parking lots and ferry Connections. The web cameras have various update frequency due to different camera types and how the communication with the cameras has been set up.\r\n\r\nFor English language use: https://www.vegvesen.no/en/the-npra/about-us/open-data/datex2 \r\n"
  },
